  false,\n\t\"url\": null,\n\t\"notes\": \"Since 1990, biota of the coral reef ecosystems
  have been annualy monitored at stations located at and in the vicinity of the Waianae
  Ocean Sewage Outfall. NODC Accession 0000794 contains surveys of 1990-1998. This
  new update includes surveys from years 2004-2010. Data from 1999 to 2003 have not
  been released. Fish census data 2004-2010 are provided in a MS Excel spreadsheet.
  Macroinvertebrate data 2009-2010 are provided in JMP Data Tables. Coral and substrate
  data 2003-2010 are provided in tables within a Adobe Acrobat (PDF) document.\",\n\t\"owner_org\":
